var logoUrls = {
  "Z": "https://www.agionet.cz/media/k2/items/cache/zasilkovna_logo-banner-900px_XL.jpg",
  "D": "https://pbs.twimg.com/profile_images/1388149186802208776/kARKF09k_400x400.png",
  "G": "https://upload.wikimedia.org/wikipedia/commons/thumb/6/62/Logo-GLS-1080x1080px.svg/1024px-Logo-GLS-1080x1080px.svg.png",
  "B": "https://www.kralovstvi-tiande.cz/files/thumbs/spojili_jsme_sily_s_balikovnou-_co_z_toho_plyne_pro_vas-/img-balikovna-logo2x.2660107650.jpg",
  "P": "https://1gr.cz/fotky/idnes/13/081/cl5/VSE4d167e_CPlogo.jpg",
  "PPL": "https://www.eman.cz/wp-content/uploads/2020/11/logo_ppl.png"
}


var wrap = document.createElement("div");
wrap.style.position = "absolute";
wrap.style.opacity = "0";
wrap.style.height = "1px";
document.body.appendChild(wrap);
for (var url of Object.values(logoUrls)) {
  var e = document.createElement("img");
  e.src = url;
  e.style.height = "1px";
  wrap.appendChild(e);
}


function main() {
  var carrierString = document.querySelector("h2").innerHTML;
  var carrierCodes = {
    "Zásilkovna": "Z",
    "Doručení na adresu": "Z",
    "GLS": "G",
    "DPD": "D",
    "Balíkovna": "B",
    "Balík do ruky": "B",
    "poštou": "P",
    "PPL na adresu": "PPL",
    "PPL na pobočku": "PPL"
  }
  var targetCode;
  for (var key of Object.keys(carrierCodes)) {
    if (carrierString.includes(key)) {
      targetCode = carrierCodes[key];
      console.log("found code", targetCode);
    }
  }

  var carrierCodeElement = document.createElement("div");

  var s = carrierCodeElement.style;
  s.position = "fixed";
  s.left = "0px";
  s.top = "0px";
  var logoUrl = logoUrls[targetCode];
  s.backgroundImage = "url(" + logoUrl + ")";
  s.width = "50px";
  s.height = "50px";
  s.borderRadius = "12px";
  s.backgroundSize = "contain";
  s.backgroundPosition = "center";
  s.zIndex = "-5";
  s.display = "table-header-group";

  document.body.appendChild(carrierCodeElement);

  addManufacturers();

  let reals = loadReals();
  function addFancyColors(e) {
    console.log("adding fancy to", e)
    const pattern = /^(\d+)\sks$/;
    const match = pattern.exec(e.children[0]?.innerHTML);
    if (match) {
      const ks = parseInt(match[1], 10);
      console.log({ks})
      if (ks > 1) {
        e.style.setProperty("background-color",
        "#ff9d9d", "important");
      }
    }
    if (e.innerHTML.toLowerCase().includes("poškozené") ||
    e.innerHTML.toLowerCase().includes("rozbalené")
    ) {
      e.style.cssText = "background-color: #fff646 !important";
    }
    e.innerHTML = e.innerHTML.replace("promo", "<span class='promo'>promo</span>")
    e.innerHTML = e.innerHTML.replace("POZOR", "<span class='pozor'>POZOR</span>")
    e.innerHTML = e.innerHTML.replace("Bazar", "<span class='bazar'>Bazar</span>")
  }
  for (var e of document.querySelectorAll(".expedition__orderContent tbody td")) {
    addFancyColors(e);
  }
  let tables = document.querySelectorAll("table");
  for (var e of tables[tables.length - 1].querySelectorAll("td")) {
    let colors = {
      1: "#ffffbb",
      2: "#ffff99",
      3: "#ffddbb",
      4: "#ffdd99",
      "novinky": "#ddddff"
    }
    for (let stockNumber in colors) {
      if (e.innerHTML.toLowerCase().includes("pozice ve skladu: " + stockNumber)) {
        e.parentElement.children[0].style.setProperty("background-color",
        colors[stockNumber], "important");
      }
    }
    addFancyColors(e);
  }
}
function addManufacturers() {
  var tables = document.querySelectorAll(".compact .compact tbody, #main-table-content");
  for (var table of tables) {
    for (var row of table.querySelectorAll("tr:not(.summary-row)")) {
      var codeElement = row.children[0];
      var productCode = codeElement.innerHTML;
      var product = productExport.products[productCode];
      if (!product) {
        product = {manufacturer: "Nutná aktualizace"}
      }
      if (!product.manufacturer) {
        product.manufacturer = "Nezadaný";
      }
      var manufacturerString = "(<b>Výrobce: " + product.manufacturer + "</b>)";
      var eanString = "(<b>EAN: " + product.ean + "</b>)";
      row.children[2].innerHTML += manufacturerString + eanString;
    }
  }
}
function loadReals() {
  let summaryTables = document.querySelectorAll("table");
  let summaryTable = summaryTables[summaryTables.length - 1];
  let result = {};
  for (let row of summaryTable.children[1].children) {
    if (row.nodeName != "TR") {
      continue;
    }
    let code = row.children[0].innerHTML;
    if (code == '') {
      break;
    }
    let amt = parseInt(row.children[6].innerHTML);
    result[code] = amt;
  }

  for (let t = 1; t < summaryTables.length; t += 2) {
    let table = summaryTables[t];
    table.children[0].children[0].children[4].innerHTML = "Reálný stav"
    for (let row of table.children[1].children) {
      let amt = result[row.children[0].innerHTML];
      if (amt) {
        row.children[4].innerHTML = amt + " ks";
      }
    }
  }
  result;
}
onload = main;


